import React, { useState } from 'react'
import './App.css';
import Header from './components/Header';
import BenchmarkDataFilter from './components/BenchmarkDataFilter'
import { ThemeProvider } from '@material-ui/core/styles';
import { toggleTheme } from './components/themes.js';
import Button from "@mui/material/Button";

class App extends React.Component {
  constructor(props){
  super(props);

  this.state = {
    selectedTheme: 'dark',
    }
  }

  getTheme = (theme) =>{
    theme === 'light' ? this.setState({selectedTheme: 'light'}) : this.setState({selectedTheme: 'dark'})
  }

  render() {
    return (
      <React.Fragment>
        <ThemeProvider theme={ toggleTheme(this.state.selectedTheme) }>
        <Button>font-size: 1rem</Button>
              <Header callback = {this.getTheme}/>
              <BenchmarkDataFilter />    

        </ThemeProvider>
      </React.Fragment>
    );
  }
}

export default App;
